  [],\n\t\"revision_timestamp\": \"2015-05-06T23:29:47.902503\",\n\t\"name\": \"omi-aura-sulphur-dioxide-so2-total-column-1-orbit-l2-swath-13x24-km-v003-nrt\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Ozone Monitoring Instrument (OMI) was
  launched aboard the EOS-Aura  satellite on July 15, 2004 (1:38 pm equator crossing
  time, ascending  mode). OMI with its 2600 km viewing swath width provides almost
  daily global coverage. OMI is a contribution of the Netherlands Space Office (NSO)
  in collaboration with Finish Meterological Institute (FMI), to the US EOS-Aura Mission.
  The principal  investigator (Dr. Pieternel Levelt) institute is the KNMI (Royal
  \ Netherlands Meteorological Institute). OMI is designed to monitor  stratospheric
  and tropospheric ozone, clouds, aerosols and smoke from  biomass burning, SO2 from
  volcanic eruptions, and key tropospheric  pollutants (HCHO,NO2) and ozone depleting
  gases (OClO and BrO). OMI  sensor counts, calibrated and geolocated radiances, and
  all derived  geophysical atmospheric products will be archived at the NASA Goddard
  \ DAAC. The Sulfer Dioxide Product 'OMSO2' from the Aura-OMI is now publicly  available
  from NASA GSFC Earth Sciences (GES) Data and Information  Services Center (DISC)
  for public access.  OMSO2 product contains three values of SO2 Vertical column corresponding
  to three a-priori vertical profiles used in the  retrieval algorithm. It also contains
  quality flags, geolocation and other ancillary information.        The shortname
  for this Level-2 OMI total column SO2 product is OMSO2 and the algorithm leads for
  this product are NASA/UMBC OMI scientists Drs. Nikolay Krotkov (nickolay.a.krotkov@nasa.gov),Kai
  Yang(kai.yang@nasa.gov) and Arlin J. Krueger(krueger@umbc.edu).       OMSO2 files
  are stored in EOS Hierarchical Data Format (HDF-EOS5). Each file contains data from
  the day lit portion of an orbit (~53 minutes). There are approximately 14 orbits
  per day. The maximum file size for the OMSO2 data product is about 21 Mbytes. On-line
  spatial and parameter subset options are available during data download A list of
  tools for browsing and extracting data from these files can be found at: http://disc.gsfc.nasa.gov/Aura/tools.shtml
  A short OMSO2 Readme Document that includes brief algorithm description and   documents
  that provides known data quality related issues are available from the UMBC OMI
  site ( http://so2.gsfc.nasa.gov/docs.php )             For more information on Ozone
  Monitoring Instrument and atmospheric data products, please visit the OMI-Aura sites:
  http://aura.gsfc.nasa.gov/ http://so2.gsfc.nasa.gov/ http://www.knmi.nl/omi/research/documents/.
  \      For the full set of Aura products and other atmospheric composition data
  available from the GES DISC, please see the links below.       http://disc.sci.gsfc.nasa.gov/Aura/
  \      http://disc.gsfc.nasa.gov/acdisc/\",\n\t\"license_title\": \"U.S. Government
